import React, { Component,  useState, useEffect } from 'react'




class Landing extends Component {
 constructor() {
   super();
   this.state = {data: []};
 }
 componentDidMount() {
   fetch("http://localhost:5000/showAll")
   .then(response => response.json())
   .then(resData => {
     this.setState({data: resData.results });
   })
 }
  render() {
    return (
      <div className="container">
        {
          this.state.data.map((dataRecord) =>{
            return <div key={dataRecord.questionTitle.value}> {dataRecord} </div>
          })
        }
        <div className="jumbotron mt-5">
          <div className="col-sm-8 mx-auto">
            <h1 className="text-center">askIT</h1>
          </div>
        </div>
        <div className="row">
          <div className="col-sm-8 mx-auto">

          </div>
        </div>
      </div>
    )
  }
}

export default Landing;
